import React from 'react'
import TableRow from './TableRow'

class Compare extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            apikey: this.props.apikey,
            date: this.props.date,
            result: []
        };
    }
    componentDidMount() {
        var myHeaders = new Headers();
        myHeaders.append("Content-Type", "application/json");

        var raw = JSON.stringify({"apikey":this.props.apikey,"method":"partner_api.get_brands","params":{"projectname":"Automotive"}});

        var requestOptions = {
            method: 'POST',
            headers: myHeaders,
            body: raw,
            redirect: 'follow'
        };

        fetch("http://localhost:3001/requests", requestOptions)
            .then(response => response.json())
            .then(json => json.result)
            .then(res => this.setState({ 'result': res }));
            // .catch(error => console.log('error', error));
        
        // this.setState({profiles: JSON.parse(this.state.data)});
        // console.log(this.state.result);
        }
    render() {
        return (
            <div>
                <table className="table table-hover">
                    <thead>
                        <tr>
                        <th scope="col">#</th>
                        <th scope="col">Brand Name</th>
                        <th scope="col">Total Profiles</th>
                        <th scope="col">Total Followers</th>
                        <th scope="col">Total Engagement</th>
                        </tr>
                    </thead>
                    <tbody>
                        <TableRow index="1" name={JSON.stringify(this.state.result)}/>
                    </tbody>
                </table>
            </div>
        )
    }
}

export default Compare;

